import React from 'react'
import katieZaferes from './images/katie-zaferes.png'
import star from "./images/star.png"

export default function Card() {
    return (
        <div className="card">
            <img src={katieZaferes} />
            <div>
                <img src={star} />
            </div>
        </div>
    )
}
